import React from 'react'
import { GetUsers } from '../DataCollection/Request'
import { useEffect, useState } from 'react';

export const RenderMeeting = (props) => {
  var x = [];
  GetUsers().then(res => {return x = res.map((data) => {
    console.log(data);
  })});
  setTimeout(()=>{
    return console.log(x);
  }, 5000)
}
